import React, { Component } from 'react'
import ApiService from "../../service/ApiService";

class ListUserComponent extends Component {

    constructor(props) {
        super(props)
        this.state = {
            ageRows: [],
			genRows:[],
            message: null
        }
        this.reloadUserList = this.reloadUserList.bind(this);
    }

    componentDidMount() {
        this.reloadUserList();
    }

    reloadUserList() {
        ApiService.fetchAgeAvg()
            .then((res) => {
                this.setState({ageRows: res.data.result})
            });
		ApiService.fetchGenderAvg()
            .then((res) => {
                this.setState({genRows: res.data.result})
            });
    }

    render() {
        return (
            <div>
                <h2 className="text-center">AgeGroup vs Average(Data Value)</h2>
                <table className="table table-striped">
                    <thead>
                        <tr>
                            <th>AgeGroup</th>
                            <th>Average(Data Value)</th>
                        </tr>
                    </thead>
                    <tbody>
                        {
                            this.state.ageRows.map(
                        row =>
                                    <tr>
                                        <td>{row}</td>
                                        <td>{row}</td>
                                    </tr>
                            )
                        }
                    </tbody>
                </table>
				
				<h2 className="text-center">Gender vs Average(Data Value)</h2>
                <table className="table table-striped">
                    <thead>
                        <tr>
                            <th>Gender</th>
                            <th>Average(Data Value)</th>
                        </tr>
                    </thead>
                    <tbody>
                        {
                            this.state.genRows.map(
                        row =>
                                    <tr>
                                        <td>{row.Gender}</td>
                                        <td>{row.Average}</td>
                                    </tr>
                            )
                        }
                    </tbody>
                </table>


            </div>
        );
    }

}

export default ListUserComponent;
